        str += '*' * (self.table_size * 4 + 7) + '\n'
        str += '*    ' + ''.join(['{0:4}'.format(x + 1) for x in range(self.table_size)]) + " *\n"

        for idx in range(self.table_size):
            str += '*{0:4}'.format(idx + 1) + ''.join(['{0:4}'.format(x) for x in self.costs[idx]]) + " *\n"

        str += "*" * (self.table_size * 4 + 7) + "\n]]"

        return str

