        travel_cost_table = TravelCostTable(self.random, self.table_size)
        travel_cost_table.costs = [[self.random.rand() for x in range(self.table_size)] for y in range(self.table_size)]

        for idx in range(self.table_size):
            travel_cost_table.costs[idx][idx] = 0

        return travel_cost_table

